"A carbohydrazide that results from the formal condensation of the carboxy group of DL-serine with the primary amino group of 4-(hydrazinylmethyl)benzene-1,2,3-triol. An aromatic-L-amino-acid decarboxylase inhibitor (DOPA decarboxylase inhibitor) that does not enter the central nervous system, it is used as its hydrochloride salt as an adjunct to levodopa in the treatment of parkinsonism. By preventing the conversion of levodopa to dopamine in the periphery, it causes an increase in the amount of levodopa reaching the central nervous system and so reduces the required dose. Benserazide has no antiparkinson actions when given alone [ChEBI]. An inhibitor of DOPA DECARBOXYLASE that does not enter the central nervous system. It is often given with LEVODOPA in the treatment of parkinsonism to prevent the conversion of levodopa to dopamine in the periphery, thereby increasing the amount that reaches the central nervous system and reducing the required dose. It has no antiparkinson actions when given alone [MeSH].", 
NA, "Bactericidal cationic quaternary ammonium surfactant used as a topical anti-infective agent. It is an ingredient in medicaments, deodorants, mouthwashes, etc., and is used to disinfect apparatus, etc., in the food processing and pharmaceutical industries, in surgery, and also as a preservative. The compound is toxic orally as a result of neuromuscular blockade [MeSH].", 
NA, "A compound formed by the condensation of two molecules of urea; the parent compound of the biuret group of compounds. Used as a non-protein nitrogen source in ruminant feed [ChEBI]. Used as feed supplement for sheep and cattle since it is a good non-protein nitrogen source. In strongly alkaline solution biuret gives a violet color with copper sulfate [MeSH].", 
NA, "A glycopeptide antibiotic produced by the bacterium Streptomyces verticillus. The term, 'bleomycin' refers to a family of structurally related compounds. When used as an anti-cancer agent, the chemotherapeutical forms are primarily bleomycin A2 and B2 [ChEBI]. A complex of related glycopeptide antibiotics from Streptomyces verticillus consisting of bleomycin A2 and B2. It inhibits DNA metabolism and is used as an antineoplastic, especially for solid tumors [MeSH].", 
