"A trimethylxanthine in which the three methyl groups are located at positions 1, 3, and 7 [ChEBI]. A methylxanthine naturally occurring in some beverages and also used as a pharmacological agent. Caffeine's most notable pharmacological effect is as a central nervous system stimulant, increasing alertness and producing agitation. It also relaxes SMOOTH MUSCLE, stimulates CARDIAC MUSCLE, stimulates DIURESIS, and appears to be useful in the treatment of some types of headache. Several cellular actions of caffeine have been observed, but it is not entirely clear how each contributes to its pharmacological profile. Among the most important are inhibition of cyclic nucleotide PHOSPHODIESTERASES, antagonism of ADENOSINE RECEPTORS, and modulation of intracellular calcium handling [MeSH].", 
"A 32-membered heterodetic cyclic peptide comprising the sequence Cys-Ser-Asn-Leu-Ser-Thr-Cys-Val-Leu-Gly-Lys-Leu-Ser-Gln-Glu-Leu-His-Lys-Leu-Gln-Thr-Tyr-Pro-Arg-Thr-Asn-Thr-Gly-Ser-Gly-Thr-Pro-NH2 cyclised by a disulfide bridge between the two Cys residues at positions 1 and 7 [ChEBI]. A peptide hormone that lowers calcium concentration in the blood. In humans, it is released by thyroid cells and acts to decrease the formation and absorptive activity of osteoclasts. Its role in regulating plasma calcium is much greater in children and in certain diseases than in normal adults [MeSH].", 
NA, "A salt used to replenish calcium levels, as an acid-producing diuretic, and as an antidote for magnesium poisoning [MeSH].", 
