NA, "A platinum-containing anticancer drug that interacts with, and forms cross-links between, DNA and proteins. It is used as a neoplasm inhibitor to treat solid tumours, primarily of the testis and ovary [ChEBI]. An inorganic and water-soluble platinum complex. After undergoing hydrolysis, it reacts with DNA to produce both intra and interstrand crosslinks. These crosslinks appear to impair replication and transcription of DNA. The cytotoxicity of cisplatin correlates with cellular arrest in the G2 phase of the cell cycle [MeSH].", 
