NA, "A picolinic acid derivative isolated from various Fusarium species. It has been proposed for a variety of therapeutic applications but is primarily used as a research tool. Its mechanisms of action are poorly understood. It probably inhibits DOPAMINE BETA-HYDROXYLASE, the enzyme that converts dopamine to norepinephrine. It may also have other actions, including the inhibition of cell proliferation and DNA synthesis [MeSH].", 
