NA, "A member of the class of 2-benzofurans that is 2-benzofuran-1(3H)-one which is substituted at positions 4, 5, 6, and 7 by methyl, methoxy, (2E)-5-carboxy-3-methylpent-2-en-1-yl, and hydroxy groups, respectively. It is an antibiotic produced by Penicillium brevi-compactum, P. stoloniferum, P. echinulatum and related species. An immunosuppressant, it is widely used (partiularly as its sodium salt and as the 2-(morpholin-4-yl)ethyl ester prodrug, mycophenolate mofetil) to prevent tissue rejection following organ transplants and for the treatment of certain autoimmune diseases [ChEBI]. An antibiotic substance derived from Penicillium stoloniferum, and related species. It blocks de novo biosynthesis of purine nucleotides by inhibition of the enzyme inosine monophosphate dehydrogenase. Mycophenolic acid is important because of its selective effects on the immune system. It prevents the proliferation of T-cells, lymphocytes, and the formation of antibodies from B-cells. It also may inhibit recruitment of leukocytes to inflammatory sites. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1301) [MeSH].", 
