"A pyridinecarboxamide in which the carboxamide group is located at position 3 [ChEBI]. An important compound functioning as a component of the coenzyme NAD. Its primary significance is in the prevention and/or cure of blacktongue and PELLAGRA. Most animals cannot manufacture this compound in amounts sufficient to prevent nutritional deficiency and it therefore must be supplemented through dietary intake [MeSH].", 
"A pyridinemonocarboxylic acid in which the carboxy group is located at position 3 [ChEBI]. A water-soluble vitamin of the B complex occurring in various animal and plant tissues. It is required by the body for the formation of coenzymes NAD and NADP. It has PELLAGRA-curative, vasodilating, and antilipemic properties [MeSH].", 
"Antineoplastic agent especially effective against malignant brain tumors. The resistance which brain tumor cells acquire to the initial effectiveness of this drug can be partially overcome by the simultaneous use of membrane-modifying agents such as reserpine, calcium antagonists such as nicardipine or verapamil, or the calmodulin inhibitor, trifluoperazine. The drug has also been used in combination with other antineoplastic agents or with radiotherapy for the treatment of various neoplasms [MeSH].", 
"An imidazolidine-2,4-dione that is hydantoin substituted at position 1 by a (5-nitro-2-furyl)methylene]amino group. An antibiotic that damages bacterial DNA [ChEBI]. A urinary anti-infective agent effective against most gram-positive and gram-negative organisms. Although sulfonamides and antibiotics are usually the agents of choice for urinary tract infections, nitrofurantoin is widely used for prophylaxis and long-term suppression [MeSH].", 
"A topical anti-infective agent effective against gram-negative and gram-positive bacteria. It is used for superficial WOUNDS AND INJURIES and skin infections. Nitrofurazone has also been administered orally in the treatment of TRYPANOSOMIASIS [MeSH].", 
