"A potent lipoxygenase inhibitor that interferes with arachidonic acid metabolism. The compound also inhibits formyltetrahydrofolate synthetase, carboxylesterase, and cyclooxygenase to a lesser extent. It also serves as an antioxidant in fats and oils [MeSH].", 
"The R-enantiomer of noradrenaline [ChEBI]. Precursor of epinephrine that is secreted by the adrenal medulla and is a widespread central and autonomic neurotransmitter. Norepinephrine is the principal transmitter of most postganglionic sympathetic fibers and of the diffuse projection system in the brain arising from the locus ceruleus. It is also found in plants and is used pharmacologically as a sympathomimetic [MeSH].", 
"A synthetic fluoroquinolone with broad-spectrum antibacterial activity against most gram-negative and gram-positive bacteria. Norfloxacin is bactericidal and its mode of action depends on blocking of bacterial DNA replication by binding itself to an enzyme called DNA gyrase [ChEBI]. A synthetic fluoroquinolone (FLUOROQUINOLONES) with broad-spectrum antibacterial activity against most gram-negative and gram-positive bacteria. Norfloxacin inhibits bacterial DNA GYRASE [MeSH].", 
"A coumarin-derived antibiotic obtained from Streptomyces niveus [ChEBI]. An antibiotic compound derived from Streptomyces niveus. It has a chemical structure similar to coumarin. Novobiocin binds to DNA gyrase, and blocks adenosine triphosphatase (ATPase) activity. (From Reynolds, Martindale The Extra Pharmacopoeia, 30th ed, p189) [MeSH].", 
