NA, "A polypeptide hormone (84 amino acid residues) secreted by the PARATHYROID GLANDS which performs the essential role of maintaining intracellular CALCIUM levels in the body. Parathyroid hormone increases intracellular calcium by promoting the release of CALCIUM from BONE, increases the intestinal absorption of calcium, increases the renal tubular reabsorption of calcium, and increases the renal excretion of phosphates [MeSH].", 
"An amino cyclitol glycoside that is the 1-O-(2-amino-2-deoxy-alpha-D-glucopyranoside) and the 3-O-(2,6-diamino-2,6-dideoxy-beta-L-idopyranosyl)-beta-D-ribofuranoside of 4,6-diamino-2,3-dihydroxycyclohexane (the 1R,2R,3S,4R,6S diastereoisomer). It is obtained from various Streptomyces species. A broad-spectrum antibiotic, it is used (generally as the sulfate salt) for the treatment of acute and chronic intestinal protozoal infections, but is not effective for extraintestinal protozoal infections. It is also used as a therapeutic against visceral leishmaniasis [ChEBI]. An oligosaccharide antibiotic produced by various STREPTOMYCES [MeSH].", 
"4-Hydroxy-4H-furo(3,2-c)pyran-2(6H)-one. A mycotoxin produced by several species of Aspergillus and Penicillium. It is found in unfermented apple and grape juice and field crops. It has antibiotic properties and has been shown to be carcinogenic and mutagenic and causes chromosome damage in biological systems [MeSH].", 
NA, "Any mixture of complex, colloidal, macromolecular plant galacturonans containing a large proportion of D-galactopyranosyluronic acid residues in alpha-(1->4) linkage, the carboxy groups of which may be esterified to varying degrees by methyl groups or be partially or completely converted into salts. The structure shown is that of the parent polygalacturonan [ChEBI].", 
"A penicillin in which the substituent at position 6 of the penam ring is a phenylacetamido group [ChEBI]. A penicillin derivative commonly used in the form of its sodium or potassium salts in the treatment of a variety of infections. It is effective against most gram-positive bacteria and against gram-negative cocci. It has also been used as an experimental convulsant because of its actions on GAMMA-AMINOBUTYRIC ACID mediated synaptic transmission [MeSH].", 
NA, "An insecticide and herbicide that has also been used as a wood preservative. Pentachlorphenol is a widespread environmental pollutant. Both chronic and acute pentachlorophenol poisoning are medical concerns. The range of its biological actions is still being actively explored, but it is clearly a potent enzyme inhibitor and has been used as such as an experimental tool [MeSH].", 
"An organosulfonate salt obtained by reaction of pentamidine with two equivalents of 2-hydroxyethylsulfonic acid [ChEBI]. Antiprotozoal agent effective in trypanosomiasis, leishmaniasis, and some fungal infections; used in treatment of PNEUMOCYSTIS pneumonia in HIV-infected patients. It may cause diabetes mellitus, central nervous system damage, and other toxic effects [MeSH].", 
