"A straight-chain pentane core with amino substitutents at positions 1 and 5. A colourless syrupy liquid diamine with a distinctive unpleasant odour, it is a homologue of putresceine and is formed by the bacterial decarboxylation of lysine that occurs during protein hydrolysis during putrefaction of animal tissue [ChEBI]. A foul-smelling diamine formed by bacterial decarboxylation of lysine [MeSH].", 
"A derivative of glycine having methyl and amidino groups attached to the nitrogen [ChEBI]. An amino acid that occurs in vertebrate tissues and in urine. In muscle tissue, creatine generally occurs as phosphocreatine. Creatine is excreted as CREATININE in the urine [MeSH].", 
"The simplest (and the only achiral) proteinogenic amino acid, with a hydrogen atom as its side chain [ChEBI]. A non-essential amino acid. It is found primarily in gelatin and silk fibroin and used therapeutically as a nutrient. It is also a fast inhibitory neurotransmitter [MeSH].", 
"A 1H-imidazol-4-yl group substituted at position C-4 by a 2-aminoethyl group [ChEBI]. An amine derived by enzymatic decarboxylation of HISTIDINE. It is a powerful stimulant of gastric secretion, a constrictor of bronchial smooth muscle, a vasodilator, and also a centrally acting neurotransmitter [MeSH].", 
"The L-enantiomer of alanine [ChEBI]. A non-essential amino acid that occurs in high levels in its free state in plasma. It is produced from pyruvate by transamination. It is involved in sugar and acid metabolism, increases IMMUNITY, and provides energy for muscle tissue, BRAIN, and the CENTRAL NERVOUS SYSTEM [MeSH].", 
"An L-alpha-amino acid that is the L-isomer of arginine [ChEBI]. An essential amino acid that is physiologically active in the L-form [MeSH].", 
"An optically active form of asparagine having L-configuration [ChEBI]. A non-essential amino acid that is involved in the metabolic control of cell functions in nerve and brain tissue. It is biosynthesized from ASPARTIC ACID and AMMONIA by asparagine synthetase. (From Concise Encyclopedia Biochemistry and Molecular Biology, 3rd ed) [MeSH].", 
"The L-enantiomer of aspartic acid [ChEBI]. One of the non-essential amino acids commonly occurring in the L-form. It is found in animals and plants, especially in sugar cane and sugar beets. It may be a neurotransmitter [MeSH].", 
"A non-essential amino acid naturally occurring in the L-form. Glutamic acid is the most common excitatory neurotransmitter in the CENTRAL NERVOUS SYSTEM [MeSH].", 
"An optically active form of glutamine having L-configuration [ChEBI]. A non-essential amino acid present abundantly throughout the body and is involved in many metabolic processes. It is synthesized from GLUTAMIC ACID and AMMONIA. It is the principal carrier of NITROGEN in the body and is an important energy source for many cells [MeSH].", 
"The L-enantiomer of the amino acid histidine [ChEBI]. An essential amino acid that is required for the production of HISTAMINE [MeSH].", 
"An L-lysine derivative that is the L-enantiomer of homoarginine [ChEBI].", 
"The L-enantiomer of homoserine [ChEBI].", "The L-enantiomer of isoleucine [ChEBI]. An essential branched-chain aliphatic amino acid found in many proteins. It is an isomer of LEUCINE. It is important in hemoglobin synthesis and regulation of blood sugar and energy levels [MeSH].", 
"The L-enantiomer of leucine [ChEBI]. An essential branched-chain amino acid important for hemoglobin formation [MeSH].", 
"An L-alpha-amino acid; the L-isomer of lysine [ChEBI]. An essential amino acid. It is often added to animal feed [MeSH].", 
"The L-enantiomer of methionine [ChEBI]. A sulfur containing essential amino acid that is important in many body functions. It is a chelating agent for heavy metals [MeSH].", 
"An L-alpha-amino acid comprising hexanoic acid carrying an amino group at C-2. It does not occur naturally [ChEBI]. An unnatural amino acid that is used experimentally to study protein structure and function. It is structurally similar to METHIONINE, however it does not contain SULFUR [MeSH].", 
NA, "An optically active form of ornithine having L-configuration [ChEBI]. An amino acid produced in the urea cycle by the splitting off of urea from arginine [MeSH].", 
"The L-enantiomer of phenylalanine [ChEBI]. An essential aromatic amino acid that is a precursor of MELANIN; DOPAMINE; noradrenalin (NOREPINEPHRINE), and THYROXINE [MeSH].", 
"Pyrrolidine in which the pro-S hydrogen at position 2 is substituted by a carboxylic acid group. L-Proline is the only one of the twenty DNA-encoded amino acids which has a secondary amino group alpha to the carboxyl group. It is an essential component of collagen and is important for proper functioning of joints and tendons. It also helps maintain and strengthen heart muscles [ChEBI]. A non-essential amino acid that is synthesized from GLUTAMIC ACID. It is an essential component of COLLAGEN and is important for proper functioning of joints and tendons [MeSH].", 
"The L-enantiomer of serine [ChEBI]. A non-essential amino acid occurring in natural form as the L-isomer. It is synthesized from GLYCINE or THREONINE. It is involved in the biosynthesis of PURINES; PYRIMIDINES; and other amino acids [MeSH].", 
"An optically active form of threonine having L-configuration [ChEBI]. An essential amino acid occurring naturally in the L-form, which is the active form. It is found in eggs, milk, gelatin, and other proteins [MeSH].", 
"The L-enantiomer of tryptophan [ChEBI]. An essential amino acid that is necessary for normal growth in infants and for NITROGEN balance in adults. It is a precursor of INDOLE ALKALOIDS in plants. It is a precursor of SEROTONIN (hence its use as an antidepressant and sleep aid). It can be a precursor to NIACIN, albeit inefficiently, in mammals [MeSH].", 
"An optically active form of tyrosine having L-configuration [ChEBI]. A non-essential amino acid. In animals it is synthesized from PHENYLALANINE. It is also the precursor of EPINEPHRINE; THYROID HORMONES; and melanin [MeSH].", 
