"An N-oxide derived from triethylamine [ChEBI].", "A primary amino compound obtained by formal decarboxylation of the amino acid tyrosine [ChEBI]. An indirect sympathomimetic. Tyramine does not directly activate adrenergic receptors, but it can serve as a substrate for adrenergic uptake systems and monoamine oxidase so it prolongs the actions of adrenergic transmitters. It also provokes transmitter release from adrenergic terminals. Tyramine may be a neurotransmitter in some invertebrate nervous systems [MeSH].", 
