NA, NA, NA, "A local anesthetic of the ester type that has a slow onset and a short duration of action. It is mainly used for infiltration anesthesia, peripheral nerve block, and spinal block. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1016) [MeSH].", 
"3,6-Diaminoacridine. Topical antiseptic used mainly in wound dressings [MeSH].", 
"A C21-steroid hormone in which a pregnane skeleton carries oxo substituents at positions 3 and 20 and is unsaturated at C(4)-C(5). As a hormone, it is involved in the female menstrual cycle, pregnancy and embryogenesis of humans and other species [ChEBI]. The major progestational steroid that is secreted primarily by the CORPUS LUTEUM and the PLACENTA. Progesterone acts on the UTERUS, the MAMMARY GLANDS and the BRAIN. It is required in EMBRYO IMPLANTATION; PREGNANCY maintenance, and the development of mammary tissue for MILK production. Progesterone, converted from PREGNENOLONE, also serves as an intermediate in the biosynthesis of GONADAL STEROID HORMONES and adrenal CORTICOSTEROIDS [MeSH].", 
"A lactogenic hormone secreted by the adenohypophysis (PITUITARY GLAND, ANTERIOR). It is a polypeptide of approximately 23 kD. Besides its major action on lactation, in some species prolactin exerts effects on reproduction, maternal behavior, fat metabolism, immunomodulation and osmoregulation. Prolactin receptors are present in the mammary gland, hypothalamus, liver, ovary, testis, and prostate [MeSH].", 
"A substituted phenothiazine in which the ring nitrogen at position 10 is attached to C-3 of an N,N-dimethylpropan-2-amine moiety [ChEBI]. A phenothiazine derivative with histamine H1-blocking, antimuscarinic, and sedative properties. It is used as an antiallergic, in pruritus, for motion sickness and sedation, and also in animals [MeSH].", 
"The cyclic ketal obtained by formal condensation of 1-(2,4-dichlorophenyl)-2-(1H-1,2,4-triazol-1-yl)ethanone with pentane-1,2-diol. A triazole fungicide, it is used commercially as a racemic mixture of diastereoisomers on soft fruit (including apricots, peaches, nectarines, plums and prunes), nuts (including peanuts, pecans and almonds), mushrooms, and grasses grown for seeds [ChEBI].", 
"A short-chain saturated fatty acid comprising ethane attached to the carbon of a carboxy group [ChEBI].", 
"A group of simple proteins that yield basic amino acids on hydrolysis and that occur combined with nucleic acid in the sperm of fish. Protamines contain very few kinds of amino acids. Protamine sulfate combines with heparin to form a stable inactive complex; it is used to neutralize the anticoagulant action of heparin in the treatment of heparin overdose. (From Merck Index, 11th ed; Martindale, The Extra Pharmacopoeia, 30th ed, p692) [MeSH].", 
"An aminonucleoside antibiotic, derived from the Streptomyces alboniger bacterium, that causes premature chain termination during translation taking place in the ribosome [ChEBI]. A cinnamamido ADENOSINE found in STREPTOMYCES alboniger. It inhibits protein synthesis by binding to RNA. It is an antineoplastic and antitrypanosomal agent and is used in research as an inhibitor of protein synthesis [MeSH].", 
"A four-carbon alkane-alpha,omega-diamine [ChEBI]. A toxic diamine formed by putrefaction from the decarboxylation of arginine and ornithine [MeSH].", 
"A pyridinecarbaldehyde that is pyridine-4-carbaldehyde bearing methyl, hydroxy and hydroxymethyl substituents at positions 2, 3 and 5 respectively [ChEBI]. The 4-carboxyaldehyde form of VITAMIN B 6 which is converted to PYRIDOXAL PHOSPHATE which is a coenzyme for synthesis of amino acids, neurotransmitters (serotonin, norepinephrine), sphingolipids, aminolevulinic acid [MeSH].", 
"The conjugate acid of pyridoxamine arising from selective protonation of the primary amino group; major species at pH 7.3 [ChEBI]. The 4-aminomethyl form of VITAMIN B 6. During transamination of amino acids, PYRIDOXAL PHOSPHATE is transiently converted into pyridoxamine phosphate [MeSH].", 
"The 4-methanol form of VITAMIN B 6 which is converted to PYRIDOXAL PHOSPHATE which is a coenzyme for synthesis of amino acids, neurotransmitters (serotonin, norepinephrine), sphingolipids, aminolevulinic acid. Although pyridoxine and Vitamin B 6 are still frequently used as synonyms, especially by medical researchers, this practice is erroneous and sometimes misleading (EE Snell; Ann NY Acad Sci, vol 585 pg 1, 1990) [MeSH].", 
NA, "A pyrroloquinoline having oxo groups at the 4- and 5-positions and carboxy groups at the 2-, 7- and 9-positions [ChEBI]. A pyrrolo-quinoline having two adjacent keto-groups at the 4 and 5 positions and three acidic carboxyl groups. It is a coenzyme of some DEHYDROGENASES [MeSH].", 
"A 2-oxo monocarboxylic acid that is the 2-keto derivative of propionic acid [ChEBI]. An intermediate compound in the metabolism of carbohydrates, proteins, and fats. In thiamine deficiency, its oxidation is retarded and it accumulates in the tissues, especially in nervous structures. (From Stedman, 26th ed) [MeSH].", 
"A pentahydroxyflavone having the five hydroxy groups placed at the 3-, 3'-, 4'-, 5- and 7-positions [ChEBI].", 
"An acridine derivative formerly widely used as an antimalarial but superseded by chloroquine in recent years. It has also been used as an anthelmintic and in the treatment of giardiasis and malignant effusions. It is used in cell biological experiments as an inhibitor of phospholipase A2 [MeSH].", 
"The (-)-enantiomer of quinic acid [ChEBI]. An acid which is found in cinchona bark and elsewhere in plants. (From Stedman, 26th ed) [MeSH].", 
"A metabolite of tryptophan with a possible role in neurodegenerative disorders. Elevated CSF levels of quinolinic acid are correlated with the severity of neuropsychological deficits in patients who have AIDS [MeSH].", 
"A macrolide isolated from Streptomyces hygroscopicus consisting of a 29-membered ring containing 4 trans double bonds, three of which are conjugated. It is an antibiotic, immunosupressive and antineoplastic agent [ChEBI]. A macrolide compound obtained from Streptomyces hygroscopicus that acts by selectively blocking the transcriptional activation of cytokines thereby inhibiting cytokine production. It is bioactive only when bound to IMMUNOPHILINS. Sirolimus is a potent immunosuppressant and possesses both antifungal and antineoplastic properties [MeSH].", 
"A 12-kDa cysteine-rich polypeptide hormone secreted by FAT CELLS in the ADIPOSE TISSUE. It is the founding member of the resistin-like molecule (RELM) hormone family. Resistin suppresses the ability of INSULIN to stimulate cellular GLUCOSE uptake [MeSH].", 
"D-Ribitol in which the hydroxy group at position 5 is substituted by a 7,8-dimethyl-2,4-dioxo-3,4-dihydrobenzo[g]pteridin-10(2H)-yl moiety. It is a nutritional factor found in milk, eggs, malted barley, liver, kidney, heart, and leafy vegetables, but the richest natural source is yeast. The free form occurs only in the retina of the eye, in whey, and in urine; its principal forms in tissues and cells are as flavin mononucleotide and flavin-adenine dinucleotide [ChEBI]. Nutritional factor found in milk, eggs, malted barley, liver, kidney, heart, and leafy vegetables. The richest natural source is yeast. It occurs in the free form only in the retina of the eye, in whey, and in urine; its principal forms in tissues and cells are as FLAVIN MONONUCLEOTIDE and FLAVIN-ADENINE DINUCLEOTIDE [MeSH].", 
"A rifamycin that is a a semisynthetic antibiotic derived from Amycolatopsis rifamycinica (previously known as Amycolatopsis mediterranei and Streptomyces mediterranei) [ChEBI]. A semisynthetic antibiotic produced from Streptomyces mediterranei. It has a broad antibacterial spectrum, including activity against several forms of Mycobacterium. In susceptible organisms it inhibits DNA-dependent RNA polymerase activity by forming a stable complex with the enzyme. It thus suppresses the initiation of RNA synthesis. Rifampin is bactericidal, and acts on both intracellular and extracellular organisms. (From Gilman et al., Goodman and Gilman's The Pharmacological Basis of Therapeutics, 9th ed, p1160) [MeSH].", 
NA, NA, "A derivative of tetracycline in which the amide function is substituted with a pyrrolidinomethyl group [ChEBI]. A pyrrolidinylmethyl TETRACYCLINE [MeSH].", 
"A member of the class of rotenones that consists of 1,2,12,12a-tetrahydrochromeno[3,4-b]furo[2,3-h]chromen-6(6aH)-one substituted at position 2 by a prop-1-en-2-yl group and at positions 8 and 9 by methoxy groups (the 2R,6aS,12aS-isomer). A non-systemic insecticide, it is the principal insecticidal constituent of derris (the dried rhizome and root of Derris elliptica) [ChEBI]. A botanical insecticide that is an inhibitor of mitochondrial electron transport [MeSH].", 
"An inorganic dye used in microscopy for differential staining and as a diagnostic reagent. In research this compound is used to study changes in cytoplasmic concentrations of calcium. Ruthenium red inhibits calcium transport through membrane channels [MeSH].", 
