NA, "A hexadienoic acid with double bonds at C-2 and C-4; it has four geometrical isomers, of which the trans,trans-form is naturally occurring [ChEBI]. Mold and yeast inhibitor. Used as a fungistatic agent for foods, especially cheeses [MeSH].", 
"An antibiotic produced by Streptomyces spectabilis. It is active against gram-negative bacteria and used for the treatment of gonorrhea [MeSH].", 
"The trication of spermidine, formed by protonation at all three nitrogens [ChEBI]. A polyamine formed from putrescine. It is found in almost all tissues in association with nucleic acids. It is found as a cation at all pH values, and is thought to help stabilize some membranes and nucleic acid structures. It is a precursor of spermine [MeSH].", 
"A polyazaalkane that is tetradecane in which the carbons at positions 1, 5, 10 and 14 are replaced by nitrogens. Spermine has broad actions on cellular metabolism [ChEBI]. A biogenic polyamine formed from spermidine. It is found in a wide variety of organisms and tissues and is an essential growth factor in some bacteria. It is found as a polycation at all pH values. Spermine is associated with nucleic acids, particularly in viruses, and is thought to stabilize the helical structure [MeSH].", 
"A macrolide antibiotic produced by Streptomyces ambofaciens. The drug is effective against gram-positive aerobic pathogens, N. gonorrhoeae, and staphylococci. It is used to treat infections caused by bacteria and Toxoplasma gondii [MeSH].", 
"A tetrasaccharide consisting of sucrose having an alpha-D-galactosyl-(1->6)-alpha-D-galactosyl moiety attached at the 6-position of the glucose [ChEBI].", 
"A amino cyclitol glycoside that consists of streptidine having a disaccharyl moiety attached at the 4-position. The parent of the streptomycin class [ChEBI]. An antibiotic produced by the soil actinomycete Streptomyces griseus. It acts by inhibiting the initiation and elongation processes during protein synthesis [MeSH].", 
NA, NA, "An alpha,omega-dicarboxylic acid resulting from the formal oxidation of each of the terminal methyl groups of butane to the corresponding carboxy group [ChEBI]. A water-soluble, colorless crystal with an acid taste that is used as a chemical intermediate, in medicine, the manufacture of lacquers, and to make perfume esters. It is also used in foods as a sequestrant, buffer, and a neutralizing agent. (Hawley's Condensed Chemical Dictionary, 12th ed, p1099; McGraw-Hill Dictionary of Scientific and Technical Terms, 4th ed, p1851) [MeSH].", 
"Sucrose is a disaccharide formed by glucose and fructose units joined by an acetal oxygen bridge from hemiacetal of glucose to the hemiketal of the fructose [ChEBI]. A nonreducing disaccharide composed of GLUCOSE and FRUCTOSE linked via their anomeric carbons. It is obtained commercially from SUGARCANE, sugar beet (BETA VULGARIS), and other plants and used extensively as a food and a sweetener [MeSH].", 
"A sulfonamide antimicrobial used for urinary tract infections and in veterinary medicine [ChEBI]. A sulfonamide antimicrobial used for urinary tract infections and in veterinary medicine [MeSH].", 
"A pyrimidine compound having a 4-aminobenzenesulfonamido group at the 2-position [ChEBI]. One of the short-acting SULFONAMIDES used in combination with PYRIMETHAMINE to treat toxoplasmosis in patients with acquired immunodeficiency syndrome and in newborns with congenital infections [MeSH].", 
"A pyrimidine compound having methyl substituents at the 4- and 6-positions and a 4-aminobenzenesulfonamido group at the 2-position [ChEBI]. A sulfanilamide anti-infective agent. It has a spectrum of antimicrobial action similar to other sulfonamides [MeSH].", 
"An isoxazole (1,2-oxazole) compound having a methyl substituent at the 5-position and a 4-aminobenzenesulfonamido group at the 3-position [ChEBI]. A bacteriostatic antibacterial agent that interferes with folic acid synthesis in susceptible bacteria. Its broad spectrum of activity has been limited by the development of resistance. (From Martindale, The Extra Pharmacopoeia, 30th ed, p208) [MeSH].", 
"Long acting sulfonamide antibacterial agent [MeSH].", "Molecule containing the sulfonamide functional group attached to aniline at the 4-position [ChEBI].", 
"A sulfur oxoanion obtained by deprotonation of both OH groups of sulfuric acid [ChEBI].", 
"A 1,3-thiazole compound having a 4-aminobenzenesulfonamido group at the 2-position [ChEBI].", 
"A sulfonamide antibacterial with an oxazole substituent. It has antibiotic activity against a wide range of gram-negative and gram-positive organisms [ChEBI]. A short-acting sulfonamide antibacterial with activity against a wide range of gram- negative and gram-positive organisms [MeSH].", 
"One of the SELECTIVE ESTROGEN RECEPTOR MODULATORS with tissue-specific activities. Tamoxifen acts as an anti-estrogen (inhibiting agent) in the mammary tissue, but as an estrogen (stimulating agent) in cholesterol metabolism, bone density, and cell proliferation in the ENDOMETRIUM [MeSH].", 
"Polyphenolic compounds with molecular weights of around 500-3000 daltons and containing enough hydroxyl groups (1-2 per 100 MW) for effective cross linking of other compounds (ASTRINGENTS). The two main types are HYDROLYZABLE TANNINS and CONDENSED TANNINS. Historically, the term has applied to many compounds and plant extracts able to render skin COLLAGEN impervious to degradation. The word tannin derives from the Celtic word for OAK TREE which was used for leather processing [MeSH].", 
"The zwitterion formed from taurine by transfer of a proton from the sulfonyl to the amino group.  It is the major species existing at physiological pH [ChEBI]. A conditionally essential nutrient, important during mammalian development. It is present in milk but is isolated mostly from ox bile and strongly conjugates bile acids [MeSH].", 
"The product of conjugation of cholic acid with taurine. Its sodium salt is the chief ingredient of the bile of carnivorous animals. It acts as a detergent to solubilize fats for absorption and is itself absorbed. It is used as a cholagogue and cholerectic [MeSH].", 
