"The amino acid zwitterion formed from thyroxine by transfer of a proton from the carboxy group to the amino group.  Major species at pH 7.3 [ChEBI]. The major hormone derived from the thyroid gland. Thyroxine is synthesized via the iodination of tyrosines (MONOIODOTYROSINE) and the coupling of iodotyrosines (DIIODOTYROSINE) in the THYROGLOBULIN. Thyroxine is released from thyroglobulin by proteolysis and secreted into the blood. Thyroxine is peripherally deiodinated to form TRIIODOTHYRONINE which exerts a broad spectrum of stimulatory effects on cell metabolism [MeSH].", 
"1H-imidazole substituted at C-1 by a (2-ethylsulfonyl)ethyl group, at C-2 by a methyl group and at C-5 by a nitro group.  It is used as an antiprotozoal, antibacterial agent [ChEBI]. A nitroimidazole antitrichomonal agent effective against Trichomonas vaginalis, Entamoeba histolytica, and Giardia lamblia infections [MeSH].", 
NA, "A amino cyclitol glycoside that is kanamycin B lacking the 3-hydroxy substituent from the 2,6-diaminoglucose ring [ChEBI]. An aminoglycoside, broad-spectrum antibiotic produced by Streptomyces tenebrarius. It is effective against gram-negative bacteria, especially the PSEUDOMONAS species. It is a 10% component of the antibiotic complex, NEBRAMYCIN, produced by the same species [MeSH].", 
NA, "A tricarboxylic acid that is glutaric acid in which one of the beta-hydrogens is substituted by a carboxy group [ChEBI].", 
"An aromatic ether that is phenol which is substituted at C-5 by a chloro group and at C-2 by a 2,4-dichlorophenoxy group. It is widely used as a preservative and antimicrobial agent in personal care products such as soaps, skin creams, toothpaste and deodorants as well as in household items such as plastic chopping boards, sports equipment and shoes [ChEBI]. A diphenyl ether derivative used in cosmetics and toilet soaps as an antiseptic. It has some bacteriostatic and fungistatic action [MeSH].", 
NA, "A phenothiazine derivative having a trifluoromethyl subsitituent at the 2-position and a 3-(4-methylpiperazin-1-yl)propyl group at the N-10 position [ChEBI]. A phenothiazine with actions similar to CHLORPROMAZINE. It is used as an antipsychotic and an antiemetic [MeSH].", 
"An antiviral derivative of THYMIDINE used mainly in the treatment of primary keratoconjunctivitis and recurrent epithelial keratitis due to HERPES SIMPLEX virus. (From Martindale, The Extra Pharmacopoeia, 30th ed, p557) [MeSH].", 
"An iodothyronine compound having iodo substituents at the 3-, 3'- and 5-positions. Although some is produced in the thyroid, most of the 3,3',5-triiodo-L-thyronine in the body is generated by mono-deiodination of L-thyroxine in the peripheral tissues. Its metabolic activity is about 3 to 5 times that of L-thyroxine. The sodium salt is used in the treatment of hypothyroidism [ChEBI]. A T3 thyroid hormone normally synthesized and secreted by the thyroid gland in much smaller quantities than thyroxine (T4). Most T3 is derived from peripheral monodeiodination of T4 at the 5' position of the outer ring of the iodothyronine nucleus. The hormone finally delivered and used by the tissues is mainly T3 [MeSH].", 
NA, "An antibiotic whose structure consists of pyrimidine 2,4-diamine and 1,2,3-trimethoxybenzene moieties linked by a methylene bridge [ChEBI]. A pyrimidine inhibitor of dihydrofolate reductase, it is an antibacterial related to PYRIMETHAMINE. The interference with folic acid metabolism may cause a depression of hematopoiesis. It is potentiated by SULFONAMIDES and the TRIMETHOPRIM-SULFAMETHOXAZOLE COMBINATION is the form most often used. It is sometimes used alone as an antimalarial. TRIMETHOPRIM RESISTANCE has been reported [MeSH].", 
